export default () => {
	return (
		<footer class="footer has-text-grey-lighter">
			<div class="container">
				<div class="content has-text-centered">
					<p>
						Başlayın: Ana sayfa · Toplantı anketleri · Kamuoyu anketleri · Anonim anketler · Mesaj panoları
					</p>
					<p>
						Destek: SSS · Blog · Yönetici bağlantısı kaybedildi · Toplantı planlayıcısı · Anket uygulaması
					</p>
					<p>Hakkımızda: İletişim · Künye · Gizlilik politikası · Şartlar</p>
					<p>X Y</p>
					{/* <div className="block">x</div> */}
					{/* <p>
						<strong>Bulma</strong> by <a href="https://jgthms.com">Jeremy Thomas</a>. The source code is
						licensed
						<a href="http://opensource.org/licenses/mit-license.php">MIT</a>. The website content is
						licensed <a href="http://creativecommons.org/licenses/by-nc-sa/4.0/">CC BY NC SA 4.0</a>.
					</p> */}
				</div>
			</div>
		</footer>
	);
};
